import React from "react";
import {Tile} from '../tile/Tile';

export const TileList = ( array
 ) => {
  return (
    <div>
      {array.map( ({name, ...rest}) => {
        return <Tile name={name} description={rest} />
      } )}
    </div>
  );
};
